import React from 'react';
import facebook from '../assets/Facebook_Icon.png';
import github from '../assets/GitHub_Icon.png';
import instagram from '../assets/Instagram_Icon.png';
import twitter from '../assets/Twitter_Icon.png';

const Footer = () => {
  return (
    <div className='footer'>
      <a href='#'>
        <img src={facebook} alt='Facebook' className='.footer-fb-icon' />
      </a>
      <a href='https://github.com/adityarfw'>
        <img src={github} alt='Github' className='.footer-gh-icon' />
      </a>
      <a href='#'>
        <img src={instagram} alt='Instagram' className='.footer-ig-icon' />
      </a>
      <a href='#'>
        <img src={twitter} alt='Twitter' className='.footer-tw-icon' />
      </a>
    </div>
  );
};

export default Footer;
